import React, { forwardRef } from 'react';

const CharacterSheet = forwardRef(({ character }, ref) => {
  if (!character) return null;

  const { name = '', level = 1, role = '', archetype = '' } = character;

  return (
    <div ref={ref} style={{ padding: '2rem', fontFamily: 'Georgia, serif' }}>
      <h1 style={{ borderBottom: '2px solid black' }}>Primus Character Sheet</h1>
      <p><strong>Name:</strong> {name}</p>
      <p><strong>Level:</strong> {level}</p>
      <p><strong>Role:</strong> {role}</p>
      <p><strong>Archetype:</strong> {archetype}</p>
    </div>
  );
});

export default CharacterSheet;
